Sawise Pengadilan Daerah Cologne mbalek maneh ing skandal RedTube minggu kepungkur lan ora diidini nyetujoni alamat IP kontroversial kasebut, menehi keputusan liyane sing kontroversial lan bisa dipertanyakan kanthi keputusan 14 O 427/13: Panulis Stock- Foto saka agensi gambar tartamtu uga kudu dijenengi liwat akses langsung saka gambar liwat URL.
Undhang- undhang kasebut ing conto pisanan babagan database gambar Pixelio . Khusus, fotografer sing adol gambar ing platform kanthi gratis entuk prent
... 
, penggugat uga nyatakake kepiye akses langsung menyang gambar bisa dicegah tanpa menehi jeneng panganggit. Kanthi pitulung jQuery, sampeyan bisa nyegah klik-tengen ing gambar:
$(function() {
$('img').each(function() {
$(this).bind("contextmenu", function(e) {
e.preventDefault();
});
});
});
Skrip kaya ngono gampang dilewati lan mula ora ana gunane lan ora efektif. Gawan informasi sumber langsung ing file gambar uga bisa dipertanyakan, amarga gambar kasebut ora cocog maneh karo kondhisi sing sad
...
ra bisa dibenerake kanthi estetis. Mayuta-yuta gambar kasebut bisa diakses kanthi gampang lan gampang didol nggunakake telusuran gambar Google.
Yen keputusan hukum iki dituduhake karo pengadilan liyane lan praktik umum kanggo panggunaan fotografi stok sing bener miturut ukum lisensi, iki bakal menehi pengaruh sing gedhe banget tumrap panggunaan materi gambar (lan video) dening agensi foto - sebutan sing dibutuhake babagan pemberitahuan hak cipta kasebut lagi dipraktekke meh ora bisa ditindakake.
